import styled from 'styled-components'
import { useState, useEffect } from 'react'
import NavItem from './NavItem'


const StyledAdminMenu = styled.div`
  background: ${props => props.theme.white};
  width: 300px;
  /* display: none; */
  :hover {
    display: none;
  }
`

const AdminMenu = () => {
  return (
    <StyledAdminMenu>
      <NavItem route="/manage-books" pageName="Manage Books" />
      <NavItem route="/manage-events" pageName="Manage Events" />
      <NavItem route="/checkouts" pageName="Manage Checkouts" />
    </StyledAdminMenu>
  )
}

export default AdminMenu
